import React from 'react';

const Skills: React.FC = () => {
  return (
    <div className="section min-h-screen flex flex-col justify-center items-center text-center bg-[#111F44] text-white">
      <h1 className="text-4xl mb-4 text-[#61dafb]">Skills</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        <div className="flex flex-col items-start">
          <h2 className="text-2xl mb-2">Programming Languages</h2>
          <ul className="list-none text-left">
            <li className="mb-1">Python</li>
            <li className="mb-1">Java</li>
            <li className="mb-1">C</li>
            <li className="mb-1">R</li>
          </ul>
        </div>
        <div className="flex flex-col items-start">
          <h2 className="text-2xl mb-2">Databases</h2>
          {/* Add your database skills here */}
        </div>
        <div className="flex flex-col items-start">
          <h2 className="text-2xl mb-2">Web Development</h2>
          {/* Add your web development skills here */}
        </div>
        <div className="flex flex-col items-start">
          <h2 className="text-2xl mb-2">Other Tools</h2>
          {/* Add your other tools skills here */}
        </div>
        <div className="flex flex-col items-start">
          <h2 className="text-2xl mb-2">Data & Machine Learning</h2>
          {/* Add your data and machine learning skills here */}
        </div>
      </div>
    </div>
  );
};

export default Skills;
